import React from "react";
import Image from "../images/image.jpg";

const intro = () => {
  return (
    <div className="md:flex-row flex flex-col justify-center items-center py-28  ">
      <div className="w-80 border-gray-300 border-8 rounded-full">
        <img className="w-60 mx-7 rounded-full" src={Image} alt="" />
      </div>
      <div className="flex flex-col items-center">
        <h1 className="text-6xl mt-8 text-green-200">Frontend</h1>
        <h1 className="text-6xl mt-3 text-green-200">Developer</h1>
        <div className="flex flex-col justify-center items-center">
          <h1 className="text-xl mt-8 text-indigo-300">
            I like to craft,different solid web{" "}
          </h1>
          <h1 className="text-xl text-indigo-300">
            designs with better efficiency and nice user experience{" "}
          </h1>
        </div>
      </div>
    </div>
  );
};

export default intro;
